import React from 'react';


const ContactList = ({ contactList }) => (
    <ul>
      {contactList.map(({ id, name, number }) => (
        <li key={id}>
          {name}: {number}
          <button>Delete</button>
        </li>
      ))}
    </ul>
);

export default ContactList;
